     &          Gi6(-n2:-n1,-n2:-n1,-n2:-n1,-n2:-n1,-n2:-n1,-n2:-n1) 
** 
      common /fillred/infilldim,infill(3) 
!$omp threadprivate(/fillred/)
      dimension istorfill(3)
