** evaluate H(...,-y) 
      call setzero(nw,Gi1,Gi2,Gi3,Gi4,Gi5,Gi6,-n2,-n1) 
      Gi1(0) = -1
      call eval1dhplatinf(-y,nw,G1,G2,G3,G4,G5,G6, 
     &                  GY1,GY2,GY3,GY4,GY5,GY6,
     &                  Gi1,Gi2,Gi3,Gi4,Gi5,Gi6,-n2,-n1) 
      if (infilldim.eq.2) then
         do i=1,2
            infill(i) = istorfill(i)
         enddo
      endif
** fill the arrays H's 
      do k1=n1,n2 
        nph1 = nphase(k1) 
