      HZ6(-1,-1,-1,0,1,1) = 
     &  + 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,1,1)
     &  - 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,-1,1,1)
     &  - 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,1,-1,1)
     &  - 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,1,1,-1)
     &  + HZ1( -1)*HZ5(0,-1,-1,1,1)
     &  + HZ1( -1)*HZ5(0,-1,1,-1,1)
     &  + HZ1( -1)*HZ5(0,-1,1,1,-1)
     &  + HZ1( -1)*HZ5(0,1,-1,-1,1)
     &  + HZ1( -1)*HZ5(0,1,-1,1,-1)
     &  + HZ1( -1)*HZ5(0,1,1,-1,-1)
     &  - HZ6(0, -1,-1,-1,1,1)
     &  - HZ6(0, -1,-1,1,-1,1)
     &  - HZ6(0, -1,-1,1,1,-1)
     &  - HZ6(0, -1,1,-1,-1,1)
     &  - HZ6(0, -1,1,-1,1,-1)
     &  - HZ6(0, -1,1,1,-1,-1)
     &  - HZ6(0,1, -1,-1,-1,1)
     &  - HZ6(0,1, -1,-1,1,-1)
     &  - HZ6(0,1, -1,1,-1,-1)
     &  - HZ6(0,1,1, -1,-1,-1)
      HZ6(-1,-1,-1,0,1,-1) = 
     &  + 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,1,-1)
     &  - 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,-1,1,-1)
     &  - HZ1( -1)*HZ1(-1)*HZ4(0,1,-1,-1)
     &  + HZ1( -1)*HZ5(0,-1,-1,1,-1)
     &  + 2.0000000000000000d+00*HZ1(-1)*HZ5(0,-1,1,-1,-1)
     &  + 3.0000000000000000d+00*HZ1(-1)*HZ5(0,1,-1,-1,-1)
     &  - HZ6(0, -1,-1,-1,1,-1)
     &  - 2.0000000000000000d+00*HZ6(0,-1,-1,1,-1,-1)
     &  - 3.0000000000000000d+00*HZ6(0,-1,1,-1,-1,-1)
     &  - 4.0000000000000000d+00*HZ6(0,1,-1,-1,-1,-1)
      HZ6(-1,-1,-1,0,-1,0) = 
     &  + 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(0)*HZ2(0,-1)
     &  - 3.3333333333333333d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,0,-1)
     &  - HZ1( -1)*HZ1(-1)*HZ1(0)*HZ3(0,-1,-1)
     &  + 2.5000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ2(0,-1)*HZ2(0,-1)
     &  + HZ1( -1)*HZ1(-1)*HZ4(0,0,-1,-1)
     &  + 3.0000000000000000d+00*HZ1(-1)*HZ1(0)*HZ4(0,-1,-1,-1)
     &  - HZ1( -1)*HZ2(0,-1)*HZ3(0,-1,-1)
     &  + HZ1( -1)*HZ5(0,-1,0,-1,-1)
     &  - 4.0000000000000000d+00*HZ1(0)*HZ5(0,-1,-1,-1,-1)
     &  + HZ2(0, -1)*HZ4(0,-1,-1,-1)
     &  - HZ6(0, -1,0,-1,-1,-1)
      HZ6(-1,-1,-1,0,-1,1) = 
     &  + 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,-1,1)
     &  - HZ1( -1)*HZ1(-1)*HZ4(0,-1,-1,1)
     &  - 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,-1,1,-1)
     &  + 3.0000000000000000d+00*HZ1(-1)*HZ5(0,-1,-1,-1,1)
     &  + 2.0000000000000000d+00*HZ1(-1)*HZ5(0,-1,-1,1,-1)
     &  + HZ1( -1)*HZ5(0,-1,1,-1,-1)
     &  - 4.0000000000000000d+00*HZ6(0,-1,-1,-1,-1,1)
     &  - 3.0000000000000000d+00*HZ6(0,-1,-1,-1,1,-1)
     &  - 2.0000000000000000d+00*HZ6(0,-1,-1,1,-1,-1)
     &  - HZ6(0, -1,1,-1,-1,-1)
      HZ6(-1,-1,-1,0,-1,-1) = 
     &  + 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,-1,-1)
     &  - 1.5000000000000000d+00*HZ1(-1)*HZ1(-1)*HZ4(0,-1,-1,-1)
     &  + 6.0000000000000000d+00*HZ1(-1)*HZ5(0,-1,-1,-1,-1)
     &  - 1.0000000000000000d+01*HZ6(0,-1,-1,-1,-1,-1)
      HZ6(-1,-1,-1,1,0,0) = 
     &  - 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(0)*HZ2(0,1)
     &  + 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,0,1)
     &  + 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ1(0)*HZ3(0,1,-1)
     &  - 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,0,1,-1)
     &  - HZ1( -1)*HZ1(0)*HZ4(0,1,-1,-1)
     &  + HZ1( -1)*HZ5(0,0,1,-1,-1)
     &  + 5.0000000000000000d-01*HZ1(0)*HZ1(0)*HZ4(-1,-1,-1,1)
     &  + HZ1(0) *HZ5(0,1,-1,-1,-1)
     &  - HZ6(0,0,1, -1,-1,-1)
      HZ6(-1,-1,-1,1,0,1) = 
     &  - 3.3333333333333333d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,1,1)
     &  + 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,1,-1,1)
     &  + HZ1( -1)*HZ1(-1)*HZ4(0,1,1,-1)
     &  - HZ1( -1)*HZ5(0,1,-1,-1,1)
     &  - HZ1( -1)*HZ5(0,1,-1,1,-1)
     &  - 2.0000000000000000d+00*HZ1(-1)*HZ5(0,1,1,-1,-1)
     &  + HZ2(0,1) *HZ4(-1,-1,-1,1)
     &  + HZ6(0,1, -1,-1,-1,1)
     &  + HZ6(0,1, -1,-1,1,-1)
     &  + HZ6(0,1, -1,1,-1,-1)
     &  + 2.0000000000000000d+00*HZ6(0,1,1,-1,-1,-1)
      HZ6(-1,-1,-1,1,0,-1) = 
     &  - 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,-1,1)
     &  - 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,1,-1)
     &  + 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,-1,1,-1)
     &  + HZ1( -1)*HZ1(-1)*HZ4(0,1,-1,-1)
     &  - HZ1( -1)*HZ5(0,-1,1,-1,-1)
     &  - 3.0000000000000000d+00*HZ1(-1)*HZ5(0,1,-1,-1,-1)
     &  + HZ2(0, -1)*HZ4(-1,-1,-1,1)
     &  + HZ6(0, -1,1,-1,-1,-1)
     &  + 4.0000000000000000d+00*HZ6(0,1,-1,-1,-1,-1)
      HZ6(-1,-1,-1,1,1,0) = 
     &  + 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,1,1)
     &  - 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,1,1,-1)
     &  + HZ1( -1)*HZ5(0,1,1,-1,-1)
     &  + HZ1(0) *HZ5(-1,-1,-1,1,1)
     &  - HZ2(0,1) *HZ4(-1,-1,-1,1)
     &  - HZ6(0,1,1, -1,-1,-1)
      HZ6(-1,-1,-1,1,1,-1) = 
     &  + HZ1( -1)*HZ5(-1,-1,-1,1,1)
     &  - 4.0000000000000000d+00*HZ6(-1,-1,-1,-1,1,1)
     &  - HZ6( -1,-1,-1,1,-1,1)
      HZ6(-1,-1,-1,1,-1,0) = 
     &  + 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,-1,1)
     &  - 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,-1,1,-1)
     &  + HZ1( -1)*HZ1(0)*HZ4(-1,-1,-1,1)
     &  + HZ1( -1)*HZ5(0,-1,1,-1,-1)
     &  - 4.0000000000000000d+00*HZ1(0)*HZ5(-1,-1,-1,-1,1)
     &  - HZ2(0, -1)*HZ4(-1,-1,-1,1)
     &  - HZ6(0, -1,1,-1,-1,-1)
      HZ6(-1,-1,-1,1,-1,-1) = 
     &  + 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(-1,-1,-1,1)
     &  - 4.0000000000000000d+00*HZ1(-1)*HZ5(-1,-1,-1,-1,1)
     &  + 1.0000000000000000d+01*HZ6(-1,-1,-1,-1,-1,1)
      HZ6(-1,-1,-1,-1,0,0) = 
     &  + 2.0833333333333333d-02*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(0)*HZ1(0)
     &  - 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(0)*HZ2(0,-1)
     &  + 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,0,-1)
     &  + 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ1(0)*HZ3(0,-1,-1)
     &  - 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,0,-1,-1)
     &  - HZ1( -1)*HZ1(0)*HZ4(0,-1,-1,-1)
     &  + HZ1( -1)*HZ5(0,0,-1,-1,-1)
     &  + HZ1(0) *HZ5(0,-1,-1,-1,-1)
     &  - HZ6(0,0, -1,-1,-1,-1)
      HZ6(-1,-1,-1,-1,0,1) = 
     &  + 4.1666666666666666d-02*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ2(0,1)
     &  - 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,-1,1)
     &  - 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,1,-1)
     &  + 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,-1,-1,1)
     &  + 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,-1,1,-1)
     &  + 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,1,-1,-1)
     &  - HZ1( -1)*HZ5(0,-1,-1,-1,1)
     &  - HZ1( -1)*HZ5(0,-1,-1,1,-1)
     &  - HZ1( -1)*HZ5(0,-1,1,-1,-1)
     &  - HZ1( -1)*HZ5(0,1,-1,-1,-1)
     &  + HZ6(0, -1,-1,-1,-1,1)
     &  + HZ6(0, -1,-1,-1,1,-1)
     &  + HZ6(0, -1,-1,1,-1,-1)
     &  + HZ6(0, -1,1,-1,-1,-1)
     &  + HZ6(0,1, -1,-1,-1,-1)
      HZ6(-1,-1,-1,-1,0,-1) = 
     &  + 4.1666666666666666d-02*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ2(0,-1)
     &  - 3.3333333333333333d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,-1,-1)
     &  + 1.5000000000000000d+00*HZ1(-1)*HZ1(-1)*HZ4(0,-1,-1,-1)
     &  - 4.0000000000000000d+00*HZ1(-1)*HZ5(0,-1,-1,-1,-1)
     &  + 5.0000000000000000d+00*HZ6(0,-1,-1,-1,-1,-1)
      HZ6(-1,-1,-1,-1,1,0) = 
     &  - 4.1666666666666666d-02*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ2(0,1)
     &  + 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,1,-1)
     &  - 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,1,-1,-1)
     &  + HZ1( -1)*HZ5(0,1,-1,-1,-1)
     &  + HZ1(0) *HZ5(-1,-1,-1,-1,1)
     &  - HZ6(0,1, -1,-1,-1,-1)
      HZ6(-1,-1,-1,-1,1,-1) = 
     &  + HZ1( -1)*HZ5(-1,-1,-1,-1,1)
     &  - 5.0000000000000000d+00*HZ6(-1,-1,-1,-1,-1,1)
      HZ6(-1,-1,-1,-1,-1,0) = 
     &  + 8.3333333333333333d-03*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(0)
     &  - 4.1666666666666666d-02*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ2(0,-1)
     &  + 1.6666666666666666d-01*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ3(0,-1,-1)
     &  - 5.0000000000000000d-01*HZ1(-1)*HZ1(-1)*HZ4(0,-1,-1,-1)
     &  + HZ1( -1)*HZ5(0,-1,-1,-1,-1)
     &  - HZ6(0, -1,-1,-1,-1,-1)
      HZ6(-1,-1,-1,-1,-1,-1) = 
     &  + 1.3888888888888888d-03*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(-1)*HZ1(-1)

      return
      end


************************************************************************
** the following routines contain th set of routines evaluating 
** irreducible 1dhpl's for various values of the arguments 
************************************************************************ 
      subroutine fillh1(y,H1,HY1,Hi1,n1,n2) 
** fillh1 evaluates the 1dhpl's of weight 1 
      implicit double precision (a-h,o-z) 
      complex*16 H1 
      dimension H1(n1:n2) 
      dimension HY1(n1:n2) 
      dimension Hi1(n1:n2) 
      parameter (pi   = 3.14159265358979324d0) 
      if ( n1.eq.-1) then 
        if ( y.ge.-1.d0 ) then 
          HY1(-1) = log(1.d0+y) 
          Hi1(-1) = 0.d0 
        elseif ( y.lt.-1.d0 ) then 
          HY1(-1) = log(-1.d0-y) 
          Hi1(-1) = 1.d0 
        endif 
        H1(-1) = dcmplx(HY1(-1),pi*Hi1(-1)) 
      endif 
      if ( y.ge.0.d0 ) then 
        HY1(0) = log(y) 
*        Hi1(0) = 0.d0 
      elseif ( y.lt.0.d0 ) then 
        HY1(0) = log(-y) 
        Hi1(0) = 1.d0 
      endif 
      H1(0) = dcmplx(HY1(0),pi*Hi1(0)) 
      if ( n2.eq.1 ) then 
        if ( y.ge.1.d0 ) then 
          HY1(1) = - log(-1.d0+y) 
          Hi1(1) = 1.d0 
        elseif ( y.lt.1.d0 ) then 
          HY1(1) = - log(1.d0-y) 
          Hi1(1) = 0.d0 
        endif 
        H1(1) = dcmplx(HY1(1),pi*Hi1(1)) 
      endif 
      return 
      end 
************************************************************************ 
      subroutine fillirr1dhplat0(y,nw,HY1,HY2,HY3,HY4,HY5,HY6,n1,n2) 
** evaluate the HPL from their power series expansions
** fillirr1dhplat0 is called by eval1dhplat0; 
** it is guaranteed that nw is in the range 1:4, and that (n1,n2) 
** take one of the pairs of values (0,1), (-1,0) or (-1,1) 
** 
** for y < 0 DOES NOT evaluates the immaginary part of H(0,y) = log(y) 
      implicit double precision (a-h,o-z) 
      dimension HY1(n1:n2),HY2(n1:n2,n1:n2),HY3(n1:n2,n1:n2,n1:n2), 
     &          HY4(n1:n2,n1:n2,n1:n2,n1:n2), 
     &          HY5(n1:n2,n1:n2,n1:n2,n1:n2,n1:n2),
     &          HY6(n1:n2,n1:n2,n1:n2,n1:n2,n1:n2,n1:n2) 
** evaluating the required 1dHPL of weight 1 
      if ( n1.eq.-1) then 
** 1+y = (1+ep)/(1-ep), ep = y/(2+y) 
** log(1+y) = log((1+y)/(1-y)) = 2*ep*(1+ep^2/3+ep^4/5+.....) 
** at y= -(r2-1) = - 0.4142135624, ep = - 0.26120387496 
** ep2 = 0.068227464296, ep2^13 = 6.9 x 10^(-16) 
         ep = y/(2.d0+y) 
         e2 = ep*ep 
*         v = log(1.d0+y) 
         v = 2*ep*(1+e2*(1.d0/ 3+e2*(1.d0/ 5+e2*(1.d0/ 7+e2*(1.d0/ 9 
     &              +e2*(1.d0/11+e2*(1.d0/13+e2*(1.d0/15+e2*(1.d0/17    
     &              +e2*(1.d0/19+e2*(1.d0/21+e2*(1.d0/23+e2*(1.d0/25    
     &              )))))))))))))
         HY1(-1) = v 
      endif 
      if (y.ge.0d0) then 
         HY1(0) = log(y) 
      else 
         HY1(0) = log(-y) 
** the immaginary part is evaluated in the calling routine eval1dhplat0 
**       Hi1(0) = 1d0 
      endif 
      if ( n2.eq.1) then 
** 1-y = (1-ep)/(1+ep), ep = y/(2-y) 
         ep = y/(2.d0-y) 
         e2 = ep*ep 
*         u = - log(1.d0-y) 
         u = 2*ep*(1+e2*(1.d0/ 3+e2*(1.d0/ 5+e2*(1.d0/ 7+e2*(1.d0/ 9 
     &              +e2*(1.d0/11+e2*(1.d0/13+e2*(1.d0/15+e2*(1.d0/17    
     &              +e2*(1.d0/19+e2*(1.d0/21+e2*(1.d0/23+e2*(1.d0/25    
     &              )))))))))))))
         HY1(1) = u 
      endif 
      if ( nw.eq.1 ) return 
** from now on nw > 1 
** evaluating the Cebyshev polynomials for the expansions 
      ep = y 
      if ( n2.eq.1) then 
        tu01 = 20d0/11d0*u 
        tu02 = 2d0*tu01*tu01 - 1d0 
        tu03 = 2d0*tu01*tu02 - tu01 
        tu04 = 2d0*tu01*tu03 - tu02 
        tu05 = 2d0*tu01*tu04 - tu03 
        tu06 = 2d0*tu01*tu05 - tu04 
        tu07 = 2d0*tu01*tu06 - tu05 
        tu08 = 2d0*tu01*tu07 - tu06 
        tu09 = 2d0*tu01*tu08 - tu07 
        tu10 = 2d0*tu01*tu09 - tu08 
        tu11 = 2d0*tu01*tu10 - tu09 
        tu12 = 2d0*tu01*tu11 - tu10 
        tu13 = 2d0*tu01*tu12 - tu11 
      endif 
      if ( n1.eq.-1 ) then 
        tv01 = 20d0/11d0*v 
        tv02 = 2d0*tv01*tv01 - 1d0 
        tv03 = 2d0*tv01*tv02 - tv01 
        tv04 = 2d0*tv01*tv03 - tv02 
        tv05 = 2d0*tv01*tv04 - tv03 
        tv06 = 2d0*tv01*tv05 - tv04 
        tv07 = 2d0*tv01*tv06 - tv05 
        tv08 = 2d0*tv01*tv07 - tv06 
        tv09 = 2d0*tv01*tv08 - tv07 
        tv10 = 2d0*tv01*tv09 - tv08 
        tv11 = 2d0*tv01*tv10 - tv09 
        tv12 = 2d0*tv01*tv11 - tv10 
        tv13 = 2d0*tv01*tv12 - tv11 
      endif 
** evaluating the expansions 
** (n1,n2) = (0,1) or (-1,1) 
      if (    ( (n1.eq.0).and.(n2.eq.1) ) 
     &    .or.( (n1.eq.-1).and.(n2.eq.1) ) ) then 
      HY2(0,1) = 
     &  - 3.781250000000000d-02 
     &  + 5.534574473824441d-01*tu01 
     &  - 3.781250000000000d-02*tu02 
     &  + 1.151036617760703d-03*tu03 
     &  - 8.659502433858922d-07*tu05 
     &  + 1.109042494804544d-09*tu07 
     &  - 1.624415058184216d-12*tu09 
     &  + 2.528376460336939d-15*tu11 
**    it would be wrong to write 
**    if ( nw.eq.2 ) return 
**    because the (n1.eq.-1).and.(n2.eq.1) case is not yet complete 
      if ( nw.gt.2 ) then 
      HY3(0,0,1) = 
     &  - 5.701592410758114d-02 
     &  + 5.598247957892565d-01*tu01 
     &  - 5.711486614505007d-02*tu02 
     &  + 3.275603992203700d-03*tu03 
     &  - 9.887255877938583d-05*tu04 
     &  + 4.021153684652295d-07*tu05 
     &  + 6.939288687864526d-08*tu06 
     &  - 7.995347631322020d-10*tu07 
     &  - 8.567978673919505d-11*tu08 
     &  + 1.526387027481200d-12*tu09 
     &  + 1.226899454816980d-13*tu10 
     &  - 2.848614761014972d-15*tu11 
     &  - 1.880542777479446d-16*tu12 
      HY3(0,1,1) = 
     &  + 3.816894981500984d-02 
     &  - 1.039843750000000d-02*tu01 
     &  + 3.828760080995617d-02*tu02 
     &  - 3.466145833333333d-03*tu03 
     &  + 1.185518160084905d-04*tu04 
     &  - 9.904555648775859d-08*tu06 
     &  + 1.331803984518588d-10*tu08 
     &  - 2.006389465106708d-13*tu10 
     &  + 3.180731062055677d-16*tu12 
      endif 
      if ( nw.gt.3 ) then 
      HY4(0,0,0,1) = 
